import React from 'react';

const Home = () => {
  const imageUrls = [
    'https://images.ctfassets.net/{imageId1}/image.jpg',
    'https://images.ctfassets.net/{imageId2}/image.jpg',
    'https://images.ctfassets.net/{imageId3}/image.jpg',
  ];

  return (
    <div>
      <h1>Home</h1>
      <div className="carousel">
        {imageUrls.map((imageUrl, index) => (
          <div key={index}>
            <img src={imageUrl} alt={`Image ${index + 1}`} />
            <p className="legend">Legend {index + 1}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
